"use strict";

const ObjectStoreError = require("./objectstore-error.js");

class SoiExceeded extends ObjectStoreError {
  constructor(cause, message) {
    super(message || "Size of uuObject exceeded.", cause);
    this.code = `${ObjectStoreError.ERROR_PREFIX}soiExceeded`;
  }
}

module.exports = SoiExceeded;
